run :: Flag -> Int -> IO ()
run f 0 = putStrLn "Finish"
run f i = do                                                                                                                                                                                                                   
            test f testTree `seq` return ()
            run f (i-1)

test :: Flag -> Root -> Int
test RunFibMin t = FibMin.fibMin_Syn_Root $ FibMin.wrap_Root (FibMin.sem_Root t) FibMin.Inh_Root
test RunChainFibMin t = ChainFibMin.fibMin_Syn_Root $ ChainFibMin.wrap_Root (ChainFibMin.sem_Root t) ChainFibMin.Inh_Root

options :: [OptDescr Flag]
options = [ Option ['1'] ["FibMin"] (NoArg RunFibMin) "Run FibMin",
            Option ['2'] ["ChainFibMin"] (NoArg RunChainFibMin) "Run ChainFibMin" ]

main :: IO ()
main = do
         args <- getArgs
         case getOpt RequireOrder options args of
           ([flag], [],      [])    -> run flag 30
           (_,     nonOpts, [])     -> error $ "unrecognized arguments: " ++ unwords nonOpts
           (_,     _,       msgs)   -> error $ concat msgs ++ usageInfo "" options
